// https://gist.github.com/wuchengwei/b7e1820d39445f431aeaa9c786753d8e
function dataURLtoBlob(dataurl: string): Blob {
  const arr = dataurl.split(','), mime = arr?.[0]?.match(/:(.*?);/)?.[1];
  const bstr = atob(arr[1]);
  let n = bstr.length;
  const u8arr = new Uint8Array(n);

  while(n--){
      u8arr[n] = bstr.charCodeAt(n);
  }
  return new Blob([u8arr], {type:mime});
}

// ffmpeg -f lavfi -i color=c=black:s=1920x1080 -f lavfi -i anullsrc=r=44100:cl=stereo -t 1 -r 30 -c:v libx264 -crf 28 -c:a aac -b:a 128k -hls_time 1 -hls_segment_type fmp4 -hls_playlist_type vod -hls_segment_filename "segment_%03d.m4s" black.m3u8
const ISO_SEGMENT = 'data:video/iso.segment;base64,';


export const blackHLS = (d: number) => {
  // const segment = URL.createObjectURL(dataURLtoBlob(ISO_SEGMENT));
  const segment = "https://labs.hyperaud.io/tmp/segment_000.m4s";
  const lines = [
    `#EXTM3U`,
    `#EXT-X-VERSION:7`,
    `#EXT-X-TARGETDURATION:1`,
    `#EXT-X-MEDIA-SEQUENCE:0`,
    `#EXT-X-PLAYLIST-TYPE:VOD`,
    Array(d).fill(0).map(() => `#EXTINF:1.000000,\n${segment}`).join('\n'),
    `#EXT-X-ENDLIST`
  ];

  return `data:text/plain;charset=utf-8,` + encodeURIComponent(lines.join('\n'));
};


